package coder;

import java.util.Objects;
import lombok.Getter;
import lombok.Setter;

/**
 *
 * @author Jesús Hernández Barrios (jhernandezb96@gmail.com)
 */
public class Code {

    //Don't touch, one code for every version, if ETECSA change the codes, only add another variable with the updated info
    public static final Code CODE_VERSION_11811022182382 = new Code("11811022182382", "");

    @Getter
    @Setter
    private String code_version;

    @Getter
    @Setter
    private String crude_code;

    public Code(String code_version, String crude_code) {
        this.code_version = code_version;
        this.crude_code = crude_code;
    }

    @Override
    public String toString() {
        return "Version=" + code_version + ", Crude=" + crude_code;
    }

}
